import React from 'react'
import { Header } from './Header';
import './UICONTROL.css';



function UICONTROL() {


    return (
        <div className='interfaz-control'><Header/>
            <div className='pantalla-control'>
                <a href='' onClick={holaMundo()} className='titulo-control'>INTERFAZ DE CONTROL</a>
                <a className="id-texto">Hola</a>
            </div>
        </div>

    )

}

function holaMundo(){
    console.log("hola mundillo")
}


export default UICONTROL;
